  state = {
    films: TMDB.films,
    faves: [],
    current: null
  }
  render() {
    console.log(TMDB);
    return (
    <div className="App">
      <div className="film-library">
        <Filmlist films={state.TMDB.films} filmsImg={TMDB.api_key} state={state}/>
        <Filmdetails films={TMDB.films}/>
      </div>
    </div>

    )
  }
}
